import s from './bookCatalogPage.module.css';
import BookElem from './BookElem/bookElem.jsx';

const BookCatalogPage = (props) =>{

  let books = props.booksList.books.map((film)=>{
     return (<BookElem info={film}/>)
   });

  return (
    <div className={s.bookCatalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.bookList}>
        {books}
      </div>
    </div>
  );
}

export default BookCatalogPage;
